import { Box, Typography, Button, Container, Grid } from '@mui/material';
import { motion } from 'framer-motion';
import { Link as RouterLink } from 'react-router-dom';
import CodeIcon from '@mui/icons-material/Code';
import BrushIcon from '@mui/icons-material/Brush';
import SpeedIcon from '@mui/icons-material/Speed';

const Home = () => {
  const features = [
    {
      icon: <CodeIcon sx={{ fontSize: 40 }} />,
      title: '깔끔한 코드',
      description: '유지보수가 용이한 깔끔한 코드 작성을 지향합니다.',
    },
    {
      icon: <BrushIcon sx={{ fontSize: 40 }} />,
      title: '아름다운 디자인',
      description: '사용자 경험을 최우선으로 생각하는 디자인을 제공합니다.',
    },
    {
      icon: <SpeedIcon sx={{ fontSize: 40 }} />,
      title: '최적화된 성능',
      description: '빠른 로딩 속도와 부드러운 애니메이션을 구현합니다.',
    },
  ];

  return (
    <Container maxWidth="lg">
      <Box
        sx={{
          minHeight: 'calc(100vh - 200px)',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          textAlign: 'center',
          position: 'relative',
          overflow: 'hidden',
        }}
      >
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          <Typography
            variant="h1"
            component="h1"
            gutterBottom
            sx={{
              background: 'linear-gradient(45deg, #6366f1 30%, #ec4899 90%)',
              backgroundClip: 'text',
              textFillColor: 'transparent',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
              mb: 2,
            }}
          >
            안녕하세요!
          </Typography>
          <Typography
            variant="h2"
            component="h2"
            gutterBottom
            sx={{ mb: 4, fontWeight: 600 }}
          >
            프론트엔드 개발자입니다
          </Typography>
          <Typography
            variant="h5"
            color="text.secondary"
            paragraph
            sx={{ maxWidth: '800px', mx: 'auto', mb: 6 }}
          >
            React와 TypeScript를 활용한 웹 개발을 전문으로 합니다.
            사용자 경험을 중요시하며, 깔끔하고 효율적인 코드 작성을 지향합니다.
          </Typography>
          <Box sx={{ display: 'flex', gap: 2, justifyContent: 'center', mb: 8 }}>
            <Button
              variant="contained"
              color="primary"
              size="large"
              component={RouterLink}
              to="/projects"
              sx={{
                px: 4,
                py: 1.5,
                borderRadius: '12px',
                fontSize: '1.1rem',
              }}
            >
              프로젝트 보기
            </Button>
            <Button
              variant="outlined"
              color="primary"
              size="large"
              component={RouterLink}
              to="/contact"
              sx={{
                px: 4,
                py: 1.5,
                borderRadius: '12px',
                fontSize: '1.1rem',
                borderWidth: 2,
                '&:hover': {
                  borderWidth: 2,
                },
              }}
            >
              연락하기
            </Button>
          </Box>
        </motion.div>

        <Grid container spacing={4} sx={{ mt: 4 }}>
          {features.map((feature, index) => (
            <Grid item xs={12} md={4} key={index}>
              <motion.div
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: index * 0.2 }}
              >
                <Box
                  sx={{
                    p: 3,
                    height: '100%',
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                    textAlign: 'center',
                    bgcolor: 'background.paper',
                    borderRadius: '16px',
                    border: '1px solid rgba(255, 255, 255, 0.1)',
                  }}
                >
                  <Box
                    sx={{
                      color: 'primary.main',
                      mb: 2,
                      p: 2,
                      borderRadius: '12px',
                      bgcolor: 'rgba(99, 102, 241, 0.1)',
                    }}
                  >
                    {feature.icon}
                  </Box>
                  <Typography variant="h5" component="h3" gutterBottom>
                    {feature.title}
                  </Typography>
                  <Typography color="text.secondary">
                    {feature.description}
                  </Typography>
                </Box>
              </motion.div>
            </Grid>
          ))}
        </Grid>
      </Box>
    </Container>
  );
};

export default Home;
